	[100538] = {100538, 100538, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100538}}, 0, 0, {}, 0, 5, 0, 0, 9, 0, 2, {}, {}, "", 0, {}, "We cannot change this world, but at least we can not be changed by this world.", "Dairy 38 ", "《Change》"},
	[100539] = {100539, 100539, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100539}}, 0, 0, {}, 0, 5, 0, 0, 10, 0, 2, {}, {}, "", 0, {}, "Don\'t let others tell you what you can\'t do. As long as you have a dream, you must pursue it. Those who can\'t do it will always tell you, neither can you. You have to work hard and pursue what you want.", "Dairy 39 ", "《Persuit》"},
	[100540] = {100540, 100540, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100540}}, 0, 0, {}, 0, 5, 0, 0, 11, 0, 2, {}, {}, "", 0, {}, "Some people live in tall buildings, some are in deep ditch, some are shining, some are covered with rust, there are thousands of people in the world, don\'t ask for it, if you are like a rainbow, you will know if you meet the top.", "Dairy 40 ", "《Rainbow》"},
